import React from "react";

export const HomeComponent = () => {
  return (
    <section>
      <header id="header">
        <img src="../../images/logo-three.png" alt="logo"></img>
      </header>
      <main id="main"></main>
      <footer id="footer"></footer>
    </section>
  );
};
